        #region Authentication

        public async Task<AuthResponse?> AuthenticateAsync()
        {
            var request = new AuthRequest(User, Password);

            var response = await _httpClient.PostAsJsonAsync(AuthUrl, request);

            if (response.IsSuccessStatusCode)
            {
                return await response.Content.ReadFromJsonAsync<AuthResponse>();
            }
            else
            {
                return null;
            }
        }

        public bool TryGetToken(AuthResponse? authResponse, out string token)
        {
            if (authResponse is not null && !string.IsNullOrWhiteSpace(authResponse?.Access_Token))
            {
                token = authResponse.Access_Token;
                return true;
            }

            token = string.Empty;
            return false;
        }

        #endregion Authentication


        #region DocumentOtpSignature

        public async Task<OtpSignatureResponse?> RequestDocumentOtpSignatureAsync()
        {
            OtpSignatureRequest request = this.CreateOtpLocalSignatureRequest();
            var credentials = Convert.ToBase64String(Encoding.UTF8.GetBytes($"{SubscriptionUser}:{SubscriptionPassword}"));
            _httpClient.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", credentials);

            var response = await _httpClient.PostAsJsonAsync(OtpSignatureUrl, request);

            if (response.IsSuccessStatusCode)
            {
                return await response.Content.ReadFromJsonAsync<OtpSignatureResponse>();
            }
            else
            {
                var error = await response.Content.ReadAsStringAsync();
                Console.WriteLine($"Erro: {response.StatusCode} - {error}");
                return null;
            }
        }

        #endregion DocumentOtpSignature

        #region DocumentReport

        public async Task<string?> GetDocumentReportAsync(Guid documentId, string language = "es")
