        #region GetDocument
        public async Task<string?> GetDocumentInfoAsync(Guid documentId)
        {
            var credentials = Convert.ToBase64String(Encoding.UTF8.GetBytes($"{SubscriptionUser}:{SubscriptionPassword}"));
            _httpClient.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", credentials);
            _httpClient.DefaultRequestHeaders.Accept.Clear();
            _httpClient.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));

            var url = $"https://pre-vidsignercloud.validatedid.com/api/v2.2/documentinfo/{documentId}";
            var response = await _httpClient.GetAsync(url);

            if (response.IsSuccessStatusCode)
            {
                using var stream = await response.Content.ReadAsStreamAsync();
                using var json = await JsonDocument.ParseAsync(stream);

                if (json.RootElement.TryGetProperty("DocStatus", out var statusProperty))
                {
                    return statusProperty.GetString();
                }

                Console.WriteLine("Property 'DocStatus' not found.");
                return null;
            }
            else
            {
                var error = await response.Content.ReadAsStringAsync();
                Console.WriteLine($"Error get info drom doc: {response.StatusCode} - {error}");
                return null;
            }
        }
        #endregion GetDocument

        #region DelUnsignedDoc

        public async Task<bool> DeleteUnsignedDocumentAsync(Guid documentId)
        {
            _httpClient.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", ApiCredentials);
            _httpClient.DefaultRequestHeaders.Accept.Clear();

            var url = $"https://pre-vidsignercloud.validatedid.com/api/v2.2/documents/{documentId}";
            var response = await _httpClient.DeleteAsync(url);

