        #region CreateDocumentBatch

        public async Task<string?> CreateDocumentBatchAsync()
        {
            DocumentBatchRequest request = this.CreateDocumentBatchRequest();
            _httpClient.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", ApiCredentials);
            _httpClient.DefaultRequestHeaders.Accept.Clear();
            _httpClient.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));

            var reqJson = JsonSerializer.Serialize(request, new JsonSerializerOptions
            {
                PropertyNamingPolicy = null, // usa os nomes exatos definidos com [JsonPropertyName]
                DefaultIgnoreCondition = JsonIgnoreCondition.WhenWritingNull
            });

            var content = new StringContent(reqJson, Encoding.UTF8, "application/json");

            var response = await _httpClient.PostAsync(CreateBatchUrl, content);

            if (response.IsSuccessStatusCode)
            {
                using var stream = await response.Content.ReadAsStreamAsync();
                using var json = await JsonDocument.ParseAsync(stream);

                if (json.RootElement.TryGetProperty("DocBatchGUI", out var DocBatchGUI))
                {
                    return DocBatchGUI.GetString();
                }

                Console.WriteLine("Property 'DocBatchGUI' not found.");
            }
            else
            {
                var error = await response.Content.ReadAsStringAsync();
                Console.WriteLine($"Erro ao criar batch de documentos: {response.StatusCode} - {error}");
            }
            return null;
        }

        #endregion CreateDocumentBatch

