                Console.WriteLine("Property 'DocGUI' not found.");
            }
            else
            {
                var error = await response.Content.ReadAsStringAsync();
                Console.WriteLine($"Err adding doc to batch: {response.StatusCode} - {error}");
            }
            return null;

        }

