        #region SendBatchToSignAsync

        public async Task<bool> SendBatchToSignAsync(Guid batchId)
        {
            var request = new
            {
                status = "close"
            };

            _httpClient.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", ApiCredentials);
            _httpClient.DefaultRequestHeaders.Accept.Clear();
            _httpClient.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));

            var url = $"https://pre-vidsignercloud.validatedid.com/api/v2.2/documentbatch/{batchId}/status";

            var json = "{\"status\":\"close\"}";

            var content = new StringContent(json, Encoding.UTF8, "application/json");

            var response = await _httpClient.PutAsync(url, content);

            if (response.IsSuccessStatusCode)
            {
                return true;
            }
            else
            {
                var error = await response.Content.ReadAsStringAsync();
                Console.WriteLine($"Error sending batch to sign: {response.StatusCode} - {error}");
                return false;
            }
        }

